import React from "react";
import Link from "react";
import "./style.css";

function IconGallery () {
    return (
        <div id="icon-array">
            <Link to={"#"}>
                <img className="link-icons" src="https://truffle-shuffle.s3.us-east-2.amazonaws.com/Assets/Icons/facebook.svg" 
                    alt="facebook icon" />
            </Link>

            <Link to={"#"}>
                <img className="link-icons" src="https://truffle-shuffle.s3.us-east-2.amazonaws.com/Assets/Icons/instagram.svg" 
                    alt="facebook icon" />
            </Link>

            <Link to={"#"}>
                <img className="link-icons" src="https://truffle-shuffle.s3.us-east-2.amazonaws.com/Assets/Icons/linked_in.svg" 
                    alt="facebook icon" />
            </Link>

            <Link to={"#"}>
                <img className="link-icons" src="https://truffle-shuffle.s3.us-east-2.amazonaws.com/Assets/Icons/twitter.svg" 
                    alt="facebook icon" />
            </Link>

        </div>

    );

}

export default IconGallery;


